INSERT INTO `company_reviews` (`id`, `name`, `email`, `subject`, `msg`, `status`, `user_id`, `created_at`, `updated_at`) VALUES
(2, 'sumon', 'sumon.wdd@gmail.com', 'product', 'There are good products and low cost', 'inactive', NULL, '2024-02-16 06:55:53', '2024-02-18 20:02:34'),
(3, 'এল এম স্বপ্নরাজ মিলন', 'support@reshub.info', NULL, 'I purchased a laptop from Lappy Valley.I used it almost 1 year without any problem. I recommended lappy valley is the best for laptop . However their behaviour with the customer is most amazing .', 'active', NULL, '2024-02-17 00:45:28', '2024-02-17 02:01:02'),
(4, 'Md. Rokibul D Islam', 'rokibulslam@gmail.com', NULL, 'I\'m delighted to express my utmost satisfaction with Lappy Valley. As a student, their generous discount made owning a high-quality laptop affordable. After using their product for nearly a month, I can confidently say that the laptop\'s performance has been exceptional, exceeding my initial expectations. Lappy Valley\'s dedication to providing budget-friendly laptops without compromising on quality has truly won me over. If you\'re searching for a trustworthy shop with a diverse range of laptops, Lappy Valley is definitely the go-to destination.', 'active', 1, '2024-02-17 01:19:02', '2024-02-17 01:23:23'),
(5, 'Md Mahbul Hasan', 'mdmahbulhasan@gmail.cm', NULL, 'It is one of the best place to buy authentic & budget friendly laptop.', 'active', 1, '2024-02-17 01:20:15', '2024-02-17 01:23:07'),
(6, 'Md Tarek Hossain', 'arekhossain@gmail.com', NULL, 'Stuff behavior\'s was amazing & their service was also good, Highly Recommended😍😍', 'active', 1, '2024-02-17 01:21:26', '2024-02-17 01:22:55'),
(7, 'Mehedi Hasan Raju', 'mehedihossain@gmail.com', NULL, 'I am really impressed with their behaviour. laptop Price is Very reasonable. if any one want to buy laptop from here,Highly recommended.', 'active', 1, '2024-02-17 01:24:51', '2024-02-17 01:43:02'),
(8, 'Pepul Khan', 'pepulhossain@gmail.com', NULL, 'I purchased a laptop from here which is in my budget. But i am more than satisfied for There behavior which was so nice and friendly. I strongly recommend this shop because of there behavior & there good devices .', 'active', 1, '2024-02-17 01:25:36', '2024-02-17 01:43:42'),
(9, 'Irene Ryomen', 'ryomenhossain@gmail.com', NULL, 'I bought hp AMD Ryzen 5 Laptop from them.Reasonable pricing, Elegant customer service and communication skills..I\'d highly recommend to buy from them.', 'active', 1, '2024-02-17 01:26:32', '2024-02-17 01:43:26'),
(10, 'Setu Paul Rajib', 'rajibhossain@gmail.com', NULL, 'Best and most trusted place for Laptop.\r\nWe have purchased 6 (Mac & Windows) laptops so far... \r\nWill procure many more in future ✌', 'active', 1, '2024-02-17 01:27:11', '2024-02-17 01:40:37'),
(11, 'Mahabub Hasan Joy', 'mahabubhasanjoy@gmail.com', NULL, 'Wonderful experience with the wonderful shop! Recently, I purchased a MacBook Air (8 GB ram, 128 GB SSD) at a very reasonable price! It\'s working pretty well and smoothly. Everyone in this shop was very helpful, humble, and polite (especially the owner). \r\nI would say Lappy Valley is the best Laptop shop in Bangladesh that you can rely on blindly! Thanks, Lappy Valley!', 'active', 1, '2024-02-17 01:28:34', '2024-02-17 01:40:24'),
(12, 'Ashikor Rahman Shuhag', 'AshikorRahmanShuhag@gmail.com', NULL, 'It\'s reasonable reliable and absolutely friendly you can trust.', 'active', 1, '2024-02-17 01:29:48', '2024-02-17 01:40:14'),
(13, 'Alam Nur', 'alamnur@gmail.com', NULL, 'Thanks 🙏 Lappy Valley For Give me Such a wonderful Device.I used Almost 1 year 💻 MacBook Pro  USA variant without Any Problem! Lappy Valley Always give you original products! And finally i said that owner of this shop really a good person!', 'active', 1, '2024-02-17 01:30:29', '2024-02-17 01:40:02'),
(14, 'এস এম স্বপ্নরাজ মিলন', 'shopnorajmilon@gmail.com', NULL, 'Lappy Valley,,,,,,,,,,,New Aria Of Life........ \r\n\"\"Tnx For Best Services\"\"\r\nআমি গত 25 শে মার্চ Lappy Valley থেকে একটা Hp Elite book 840 G3 Core I5 ল্যাপটপ নিয়েছিলাম। এখন পর্যন্ত সর্বোচ্চ সার্ভিস দিয়ে যাচ্ছে,,,, কোন সমস্যা দেখা যায়নি,,,,, আসলে ল্যাপটপটি অনেক ভালো,,,, আর সবচেয়ে মজার ব্যাপার হচ্ছে ভাইদের ব্যবহার ,,,, ।।।। যদি কেউ ল্যাপটপ নিতে চান তাহলে Lappy Valley থেকে নিতে পারেন।।।।। নিশ্চিন্তে ভালো সার্ভিস পাবেন ..\r\nTnx for everything', 'active', 1, '2024-02-17 01:31:48', '2024-02-17 01:39:48'),
(15, 'Md Rana Morol', 'ranamorol@gmail.com', NULL, 'লেপ্টপ নিয়েছি ৪ টা। আগের গুলোতে কিছু লেখা হয়নি,এখন না বললেই নয়।তাদের থেকে নেয়া প্রত্যেকটা ডিভাইস ই খুবই ভালো। last I can say, I\'m more than satisfied. তাদের ব্যবহার, আন্তরিকতা নিয়ে কিছু বলার নাই💥💥\r\nবিশেষ করে রাব্বানী ভাইয়ের ব্যবহার অসাধারণ ❤️❤️\r\nতাদের থেকে নেয়া ডিভাইস ঃ২ টা mt44,Lenovo Ideapad 3,DELL Inspiron 15.', 'active', 1, '2024-02-17 01:33:34', '2024-02-17 01:39:33'),
(16, 'Yasin Arafat', 'yasinarafat125@gmail.com', NULL, 'Hp elitebook Mt44 ল্যাপটপ টা সিরিয়াসলি অনেক জোস একটা ল্যাপটপ। যেমন দেখতে তেমন কাজে। আর ল্যাপটপের মতনই ভালো মোস্তাফিজ আংকেল আর গোলাম রব্বানী ভাই।( আমি এমন ই রব্বানী ভাই এর ডায়লগ😃😃)\r\nকিন্তু ল্যাপি ভ্যালি তে প্রায় আদা ঘণ্টা ৪৫ মিনিট বসেছিলাম, ওয়েট করছিলাম তো ল্যাপি ভ্যালি থেকে আমাকে এক গ্লাস পানিও অফার করেনি নাস্তা তো অনেক দূরের কথা। এটা আমি গায়ে লাগায়নি তবে গেছিলাম দুলাভাই এর সঙ্গে তো উনি খুব মাইন্ড করেছেন।\r\nতো যাইহোক ল্যাপটপ টা অনেক ভালো, আমি নিছি আপনারাও নিয়ে পারেন।', 'active', 1, '2024-02-17 01:34:19', '2024-02-17 01:39:21'),
(17, 'MD Tarikul Khan', 'tarikul145@gmail.com', NULL, 'Valobashar r ak name lappy valley💞😍best product ands best services 🥰Onak Onak Valobasha Roilo Uncle ar Jonno💞💞😍.', 'active', 1, '2024-02-17 01:35:10', '2024-02-17 01:39:06'),
(18, 'Sabuj Islam', 'sabujislam354@gmail.com', NULL, 'কিছুদিন আগে আমি তাদের থেকে একটা laptop ক্রয় করি । আমি সবচেয়ে বেশি আশ্চর্য হয়েছি তাদের ব্যাবহার এ। তাদের ব্যাবহার ছিল just Amazing । তাদের ব্যাবহার এ আপনি বাধ্য হবেন তাদেরকে  trust করতে। একজন  ক্রেতা যখন used laptop ক্রয় করতে চাইবে তখন সে অবশ্যই চাইবে যে সে যেন একটা trusted place থেকে ক্রয় করতে পারে। আমি মনে করি lappy valley সেই  trust অর্জন করতে পেরেছে।\r\nএবার আসি product এর কথায়ঃ- \r\nআমি hp 840 g3 laptop ক্রয় করি । আসলে ঐ ভাইয়েরাই আমাকে suggest করেছিলেন যে আমার budget অনুযায়ী ঐ laptop best হবে। আমি তাদের কথামতই নিলাম। আজ ৪ দিন যাবত use করতেছি কোন সমস্যা পাইনি। একদম নতুনের মত আমার  laptop । battery backup পাচ্ছি ৪ ঘন্টা।\r\nThank you lappy valley family, for helping me with such a good product. If you carry on this behavior with customer then:-\r\nI wish that, you will get a great success in future.', 'active', 1, '2024-02-17 01:36:07', '2024-02-17 01:38:47'),
(19, 'M Murad Rahman Aranyo', 'muradrahman657@gmail.com', NULL, 'অনেকদিন থেকে ভাবছিলাম একটা ইউজড ল্যাপটপ কিনবো,\r\nমেয়ের অনলাইন ক্লাস, আমার অফিসের অনলাইন মিটিং একদিন একসাথে পড়ে গেল। তখন খুব তাড়াতাড়ি একটা ল্যাপটপ দরকার ছিল, ইউটিউব ভিডিও দেখে লেপি ভ্যালির মুস্তাফিজ ভাইকে ফোন দিলাম, 24 ঘণ্টার মধ্যে ল্যাপটপ পাঠিয়ে দিলো। আমেরিকার ইউজড ল্যাপটপ, আমার কাছে একদম নতুনই মনে হল, ও খুব ভালো পারফরম্যান্স দিচ্ছে।', 'active', 1, '2024-02-17 01:36:56', '2024-02-17 01:38:29');
